import React from 'react'
import { Main, MainGrid } from './Webdevelopment.element';
import Component_header from './component_header';
import { IconContext } from 'react-icons/lib';
import { GrAnchor } from "react-icons/gr";
import Header from './Container_heading';
import laptop from '../../images/pexels-negative-space-169573.jng'

function Webdevelopment() {

    return (
<Main>
<Component_header/>
<Header/>
<MainGrid>
    <img src={laptop}></img>
</MainGrid>
</Main>
    )
}

export default Webdevelopment
